import React from 'react';
import Button from '@material-ui/core/Button';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import DialogTitle from '@material-ui/core/DialogTitle';
import { useDispatch } from 'react-redux';
import { deleteHealthTips } from './../../../actions/healthtips';

export default function AlertDialog(props) {

const dispatch = useDispatch()
// const  deleteTips = (value) => {
//     console.log("am here for delete")
//         if(value){
//             dispatch(deleteHealthTips(value))
//         }
//         //props.handleClose();
//      } 

  return (
    <div>
      <Button variant="outlined" color="primary" onClick={props.handleClickOpen}>
        Open alert dialog
      </Button>
      <Dialog
        open={props.open}
        onClose={props.handleClose}
        aria-labelledby="alert-dialog-title"
        aria-describedby="alert-dialog-description"
      >
        <DialogTitle id="alert-dialog-title">{"Are you sure you want to delete this Health Tips?"}</DialogTitle>
        <DialogContent>
          <DialogContentText id="alert-dialog-description">
            {props.tips.title}
          </DialogContentText>
        </DialogContent>
        <DialogActions>
          <Button onClick={()=>{
              dispatch(deleteHealthTips(props.tips.id))
              props.handleClose
              }} color="secondary">
            Yes
          </Button>
          <Button onClick={props.handleClose} color="primary" autoFocus>
            No
          </Button>
        </DialogActions>
      </Dialog>
    </div>
  );
}
